SELECT distinct
    st.student_id
    ,sch.school_name AS "Graduation School"
    ,pe.hs_diploma_school_year as "Graduation Year"
    ,min(pe.postsec_enrol_begin_date) as "Post Sec Start Date"
    ,pe.postsec_school_name "Post Sec School"
    ,pe.postsec_state as "Post Sec State"
    ,pe.postsec_years_offered_desc || ' - ' || pe.postsec_public_private as "Post Sec School Type"
    ,max(pe.postsec_enrol_ontime_indicator) as "Ontime Enrollment"
    ,max(pe.postsec_graduated_indicator) as "Graduated"
FROM
    K12INTEL_DW.MPSF_POSTSEC_ENROL pe
    INNER JOIN K12INTEL_DW.DTBL_SCHOOLS sch ON sch.school_key = pe.hs_diploma_school_key
    INNER JOIN K12INTEL_DW.DTBL_STUDENTS st on st.student_key = pe.student_key
